import React from 'react';
import logo from './logo.svg';
import './App.css';
// import Menu from "./components/Mainmenu";
import MenuMain from "./components/menu";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>
      <body>
      <MenuMain />
      </body>
    </div>
  );
}

export default App;
